            if (mSuccess && !mOperation.equals(BatchOperator.TRUNCATE)) {
                return HaloContentInstance.deserialize(getRawData(), Halo.instance().framework().parser());
            }
        } catch (HaloParsingException parsingExcetion) {
            return null;
        }
